import { Component } from '@angular/core';
import { FetchMovieDataComponent } from './fetch-movie-data/fetch-movie-data.component';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html'
})
export class AppComponent {
  title = 'CS575 - Movie Filtering App';
  movies: any;
  readCsvService: any;
  http: any;
  ngOnInit(): void {
    FetchMovieDataComponent.getMovies().subscribe(movies => {
      this.movies = movies;
      this.readCsvService.getMovieByID(1).subscribe(movie => {
        console.log(movie);
      });
    });
    // Get movies from asp.net core web api
    this.http.get<any[]>('api/movies').subscribe(movies => {this.movies = movies;});
  }
}
